import React from "react";
import "./RoomList.scss";

function RoomList() {
  return (
    <div className="RoomList">
      <div className="container"></div>
      <div className="list-item">
        <h3>Room Name</h3>
        <h4>0/8</h4>
        <button>Join</button>
      </div>
    </div>
  );
}

export default RoomList;
